INSERT INTO `destinations` (`id`, `name`, `place`, `location`, `category`, `image`, `description`, `latitude`, `longitude`) VALUES
(6, 'Hidden Paradise', 'Baco', 'San Ignacio, Baco', 'Destination', 'Baco/hiddenparadise.jpg', 'Hidden Paradise allows you to experience the cold, clear water of the Alpaparay River. It has a natural spring that flows through the swimming pool, which is surrounded by huts and cottages for picnics or simply relaxing.', '13.2913', '121.0728'),
(7, 'Infinity Farm', 'Baco', 'Mangangan 1, Baco', 'Destination', 'Baco/infinityfarm.jpg', 'Infinity Farm is a paradise with well-paved boardwalks, riverside cottages, and plenty of space for a peaceful retreat. The constant rumble of the flowing Mangangan River waters will help you relax and feel therapeutic vibes.', '13.254067024041294', '121.01480392999262'),
(9, 'Kambal Bato', 'Baco', 'Dulangan III, Baco', 'Destination', 'Baco/kambalbato.jpg', 'located at dulangan 3', '13.4120', '121.1276'),
(10, 'Mangyan Cubool: Cultural Booth Of Love', 'Baco', 'Graciano Dela Chica Mangyan High School, San Ignacio, Baco', 'Destination', 'Baco/mangyancubol.jpg', 'CuBooL, which translates to \"cultural booth of love,\" lives up to its name by not only providing visitors with Instagram-worthy shots but also promoting Mangyan culture through informative signs scattered throughout the area.', '13.256046332337016', '121.0718405378665'),
(11, 'Mt. Halcon', 'Baco', 'Baco, Oriental Mindoro', 'Destination', 'Baco/mthalcon.jpg', 'Mount Halcon serves as a natural boundary between Oriental and Occidental Mindoro. It is the province\'s highest peak and one of the province\'s symbols. It is the 18th highest mountain in the Philippines, standing at 2,586 meters (8,484 feet). It is also one of the best hiking destinations and one of the most difficult mountains to climb in the country, with long, often steep trails through dense jungle, crystal-clear rivers, and a magnificent summit with a breathtaking view of a sea of clouds.', '13.262917357870718', '120.99499995771093'),
(12, 'Tagbungan Mountain Resort & Lantuyang River', 'Baco', 'Dulangan III, Baco', 'Destination', 'Baco/tagbungan.jpg', 'The Tagbungan Mountain Resort, located at the foot of Mt. Halcon, is a swimming paradise in the middle of a forest. The resort features man-made falls fed directly by the Lantuyan River. To make the most of your visit, the property also has rooms where you can stay overnight.', '13.305968780499986', '121.06534123556199'),
(14, 'Tampisaw', 'Baco', 'San Ignacio, Baco', 'Destination', 'Baco/tampisaw.jpg', 'Tampisaw offers one-with-nature vibes with their glamping tents and the overall ambiance of the area, making it a haven for nature and eco lovers.', '13.308112138810236', '121.06967931823804'),
(17, 'Harka Piloto Fish Sanctuary', 'Calapan', 'Lazareto, Calapan City', 'Destination', 'Calapan/harka piloto.jpg', 'Harka Piloto Island, about 1.5 kilometers off the coast of Brgy Lazareto, is a fish sanctuary that has been actively protected by the community and the local government. Harka Ploto is now an excellent diving and snorkeling location. This sanctuary, teeming with colorful fish and corals, is just a short distance from the Verde Island Passage, the World\'s Center of Marine Biodiversity.', '13.44358272915891', '121.21966457630847'),
(18, 'Calapan City Museum', 'Calapan', 'Calapan New City Hall, Calapan city', 'Destination', 'Calapan/calapan city museum.jpg', 'Located in Brgy. Calapan\'s new City Hall. Guinobatan, the Calapan City Museum, houses interesting artifacts from Calapan\'s colorful history. These include the previous leaders of the municipality and the now-city of Calapan\'s possessions, must-see photos of the old Calapan, and other historical tidbits that will pique your interest.', '13.374602713620774', '121.18983896550374'),
(19, 'Sto Nino Cathedral', 'Calapan', 'Ibaba East, Calapan City', 'Destination', 'Calapan/cathedral.jpg', 'Sto. Tomas is the mother parish of the Apostolic Vicariate of Calapan and, for many, the \"Seat of Christianity\" in Oriental Mindoro. The Nio Cathedral is located in the heart of Calapan City, the province\'s capital. It is a very active and vibrant parish comprised of 15 Christian communities or Pamayanang Kristyano, 3,466 Catholic Families, and the greatest number of religious organizations that support and assist the parish in implementing its programs.', '13.4146', '121.1803'),
(20, 'Inay\'s Place', 'Calapan', 'Biga, Calapan City', 'Destination', 'Calapan/inays place.jpg', '', '13.314060919178825', '121.16621582740368'),
(21, 'Lamesang Bato', 'Calapan', 'Salong, Calapan City', 'Destination', 'Calapan/lamesangbato.jpg', 'Lamesang Bato is reached after a short hike. You\'ll find a peaceful retreat with nature here, with a spectacular view of the Calapan City Port and the Bay of Calapan City.', '13.420752395412743', '121.19040752535645'),
(22, 'Mahal na Pangalan Marine Park', 'Calapan', 'Mahal na Pangalan, Calapan City', 'Destination', 'Calapan/marine park.jpg', 'Visitors to Mahal na Pangalan Marine Park will be greeted by colorful murals painted by talented Calapan City students. A narrow boardwalk will lead from the mangrove area to the newly declared marine protected area in Brgy. Calapan City\'s Mahal na Pangalan.', '13.404522804480493', '121.14554886780688'),
(23, 'Nature Park', 'Calapan', 'Bulusan, Calapan City', 'Destination', 'Calapan/nature park.jpg', 'Calapan Nature Park provides a refreshing tropic atmosphere for both residents and visitors. Century-old trees abound throughout the park, which also includes recreational areas, picnic and camping areas, a mini zoo, and wall climbing facilities. The park is also the starting point for the one-hour Bulusan eco-trail, which leads to the seashore in Barangay Parang. Trekking, jogging, mountain biking, camping, and other outdoor recreational activities are ideal in the park.', '13.404961777029627', '121.1991656068075'),
(24, 'ORIENTAL MINDORO HERITAGE MUSEUM', 'Calapan', 'Ibaba East, Calapan City', 'Destination', 'Calapan/ormin heritage.jpg', 'The Oriental Mindoro Heritage Museum (OMHM) was constructed on the grounds of the Old Provincial Capitol of Oriental Mindoro in Brgy. Calapan City\'s Ibaba East neighborhood is home to the Cal-kuta, an abandoned Spanish fortress. Its features are inspired by the \"MAHAL TANA\" theme, which highlights the iconic symbols of Oriental Mindoro – Mangyan, Halcon, Tamaraw, and Naujan Lake – and are a combination of classic and modern designs.', '13.414964088957293', '121.18017011275894'),
(25, 'Calapan City Plaza', 'Calapan', 'Ibaba East, Calapan City', 'Destination', 'Calapan/plaza.jpg', '\"The plaza serves as a rotonda, with a cemented gazebo in the center, surrounded by a spiraling staircase leading to its rooftop, where you\'ll find a statue of a Mangyan next to a Tamaraw, a dwarf buffalo endemic to Mindoro. The Mangyans are Mindoro\'s indigenous people. Also found in this plaza are a relief sculpture of Mindoro and a monument of Dr. Jose Rizal', '13.414778446172974', '121.17902821419122'),
(26, 'Silonay Mangrove ', 'Calapan', 'Silonay, Calapan City', 'Destination', 'Calapan/silonay.jpg', 'Silonay Mangrove Conservation and Ecopark, located in Barangay Silonay, Calapan City, is 42 hectares in size and features a 350-meter boardwalk that leads to a 6-meter high tower with a panoramic view of the Silonay River and the adjacent sea. According to the 2014 flora and fauna survey, it was home to 15 species of mangroves, 29 species of birds (7 of which are endemic to the Philippines), 2 species of bats, and 5 species of reptiles and amphibians.', '13.400945063368814', '121.2251015187282'),
(30, 'Aras Cave', 'San Teodoro', 'Bigaan, San Teodoro', 'Destination', 'Santeodoro/aras cave.jpg', 'You\'ll arrive at Aras Cave after about 30 minutes of hiking through the shrubbery. Every cave provides a unique experience, and Aras provides just that with a waterfall inside.', '13.384235101960439', '121.00774871194035'),
(32, 'Aras Falls', 'San Teodoro', 'Bigaan, San Teodoro', 'Destination', 'Santeodoro/aras falls.jpg', 'This two-to-three-story-tall waterfall cascades into a silted water basin. The waterfall\'s rocky, well-shaded surroundings will truly immerse you in nature and its timeless beauty.', '13.410969288761741', '120.99655781194079'),
(33, 'Botolan Falls', 'San Teodoro', 'Caagutayan, San Teodoro', 'Destination', 'Santeodoro/botolan falls.jpg', 'Botolan Falls, also known as the Twin Falls of San Teodoro, is a two-tiered waterfall accessible after a 15-minute hike.', '13.27489906037967', '120.96468659659739'),
(34, 'Calabugao Ecopark', 'San Teodoro', 'Lumangbayan, San Teodoro', 'Destination', 'Santeodoro/calabugao ecoaprk.jpg', 'This new San Teodoro attraction offers a concrete boardwalk tour through decades-old mangrove trees. Take a refreshing walk in the cool shade of the trees, listening to the buzzing of nature.', '13.41815284670985', '121.03399114447159'),
(36, 'Camatis Falls', 'San Teodoro', 'Caagutayan, San Teodoro', 'Destination', 'Santeodoro/camatis falls.jpg', 'Camatis Falls, named after its location at Sitio Camatis, is another waterfall hidden beneath San Teodoro\'s greenery.', '13.413394158749629', '120.98929449234377'),
(37, 'Punta Baluarte', 'San Teodoro', 'Lumangbayan, San Teodoro', 'Destination', 'Santeodoro/punta baluarte.jpg', 'Punta Baluarte was a Spanish fortress that was constructed in the 1800s. During the colonial period, it witnessed the bloody and brutal \"pangangayaw.\" It is now a testament to the area\'s rich and significant history.', '13.418413745679127', '121.03380875427013'),
(38, 'Punta Ilag', 'San Teodoro', 'Ilag, San Teodoro', 'Destination', 'Santeodoro/punta ilag.jpg', 'This extraordinary rock formation in Brgy will astound you. Because of its uncanny resemblance to a turtle, Ilag, San Teodoro. A hundred or so steps uphill will take you to the \"guardhouse\" on top of this formation, where you will be blown away by the 360-degree view of the San Teodoro mountains and the Punta Ilag Fish Sanctuary.', '13.451888984086175', '120.97752099659984'),
(39, 'Tukuran Cart Services', 'San Teodoro', 'Calsapa, San Teodoro', 'Destination', 'Santeodoro/tukuran cart.jpg', 'Experience this unusual mode of transportation in Calsapa, San Teodoro, as you ride a carabao-pulled cart to Tukuran Falls in Puero Galera. Before arriving at your destination, you can take in the rustic scenery and lush greenery.', '13.422780777463723', '121.00997305427019'),
(40, 'Bansud Municipal Park And Plaza', 'Bansud', 'Poblacion, Bansud', 'Destination', 'Bansud/park.jpg', 'The Municipal Park and Plaza, located directly across from Bansud\'s Municipal Hall, is a large recreational area with paddle boating and fishing. Inside the plaza is a man-made lagoon that hatches tilapia for fishing activities.', '12.864182895467014', '121.45584624347853'),
(41, 'Bansud Museum', 'Bansud', 'Poblacion, Bansud', 'Destination', 'Bansud/museum.jpg', 'The Bansud Museum, located within the grounds of the Municipal Hall and Plaza, houses the town\'s artifacts and historical relics.', '12.861514418534199', '121.46464691454587'),
(42, 'Bato Viewing Hills', 'Bansud', 'Bato, Bansud', 'Destination', 'Bansud/bato viewing.jpg', 'Bato Viewing Hills is a relaxing destination ideal for unwinding and meditation, with views of lush forests, mountainous landscapes, and the overall wonder of nature.', '12.783054368137789', '121.41454766994813'),
(43, 'Batong Buwaya River', 'Bansud', 'Rosacara, Bansud', 'Destination', 'Bansud/batong buwaya river.jpg', 'The Batong Buwaya River is well-known for its rock formation that resembles a crocodile\'s head with an open mouth. Its untouched natural rock formations, cool, flowing water through filtering stones, and surrounding greenery add to its allure for those seeking a quiet retreat with nature.', '12.821776869380695', '121.2923583866425'),
(44, 'Manihala Waterfalls', 'Bansud', 'Minahala, Bansud', 'Destination', 'Bansud/manihala waterfalls.jpg', 'Manihala Falls requires about 10-minutes of trekking. It has a captivating cascade of spring water flowing through sedimentary rocks, forming a water pool at the bottom where you can swim, fish, or picnic.', '12.802689589262716', '121.42139095200373'),
(45, 'Paypay Ama Waterfalls', 'Bansud', 'Bato, Bansud', 'Destination', 'Bansud/paypay ama waterfalls.jpg', 'Paypay Ama Waterfalls can be reached via an exciting upland nature trail. Plunge into the cool waters or simply relax and unwind while listening to the gushing water.', '12.809300215354478', '121.29934789260035'),
(46, 'Rosacara Rolling Hills', 'Bansud', 'Rosacara, Bansud', 'Destination', 'Bansud/rosacara rolling hills.jpg', 'Rosacara Rolling Hills, with its lush greenery and adventurous trails leading to the top of the hills, provides a peaceful ambiance with a cool mountain breeze for nature lovers and adventure seekers.', '12.833844602492727', '121.43938338459323'),
(47, 'Sunken Cemetery', 'Bansud', 'Proper, Bansud', 'Destination', 'Bansud/sunken cemetery.jpg', '', '12.858058988030018', '121.47884525511226'),
(48, 'Kuta Shrine', 'Bongabong', 'Anilao, Bongabong', 'Destination', 'Bongabong/kuta shrine.jpg', 'The Kuta Church Ruins in Anilao, Bongabong are the remains of an 18th century church. At the time, it serves as a place of worship as well as a fortress against Moro invaders. The church is thought to have been burned down and abandoned as a result of the Moro\'s constant attacks between 1753 and 1754. The National Historical Commission designated the site as a National Historical Landmark on June 25, 2012, making it the first in Oriental Mindoro.', '12.723604540265404', '121.51307202128696'),
(49, 'Sukol River', 'Bongabong', 'Ipil, Bongabong', 'Destination', 'Bongabong/sukol river.jpg', 'Sukol River is one of Bongabong\'s four major rivers. It is lined with various species of magrove forests and is teeming with birds and other fauna.', '12.740828318458227', '121.49329493272393'),
(50, 'Tawiran Sa Mapang', 'Bongabong', 'Mapang, Bongabong', 'Destination', 'Bongabong/tawiran sa mapang.jpg', 'The most popular activities in Tawiran sa Mapang are tubing and kayaking. Visitors can enjoy the cool, rushing water and bask in the sun on the banks of the Bongabong River, which is lined with cottages.', '12.684624405287053', '121.40595139867989'),
(51, 'Tesoro Resort', 'Bongabong', 'Mapang, Bongabong', 'Destination', 'Bongabong/tesoro resort.jpg', 'You can rent huts and cottages on a more private section of the Bongabong River to fully enjoy the destination.', '12.683787045303553', '121.39968575883043'),
(52, 'Aslom Island', 'Bulalacao', 'Milagrosa, Bulalacao', 'Destination', 'Bulalacao/aslom island.jpg', 'Because of the abundance of sampalok (tamarind) trees, Aslom Islet in Bulalacao got its name from the Cebuano word aslom, which means \"sour.\" The crescent-shaped white sandbar that stretches for about 500 meters distinguishes the islet.', '12.266359217718744', '121.27677772554671'),
(53, 'Buyayao Island', 'Bulalacao', 'Buyayao, San Roque, Bulalacao', 'Destination', 'Bulalacao/buyayao.jpg', 'Buyayao Island is a 206-hectare forest reserve with over 500 forest species growing among thick vegetation and ornamental plants. Aside from its abundant wildlife, the island\'s corals and marine diversity make it ideal for snorkeling and diving.', '12.382775781992075', '121.4184944181673'),
(54, 'Pocanil Rock Formation', 'Bulalacao', 'Pocanil, San Roque, Bulalacao', 'Destination', 'Bulalacao/pocanil.jpg', 'Pocanil Rock Formation is adjacent to Pocanil Beach Resort, which serves as a launching point for trips to Buyayao Island. Rappelling, rock climbing, and spelunking are all popular activities at the Pocanil Rock Formation.', '12.395685896898891', '121.39514847242681'),
(55, 'Suguicay Island', 'Bulalacao', 'Suguicay, San Juan, Bulalacao', 'Destination', 'Bulalacao/suguicay.jpg', 'Suguicay Island is one of the lovely islands in Bulalacao, Oriental Mindoro. It is an ideal location for those looking to recharge their batteries and take a break from the mental and emotional stresses of modern life. The boat ride from Bangkal Staging Point in Brgy. Suguicay Island is accessible from San Juan. Its inviting turquoise waters, fine white sand, and the soothing sound of the waves are ideal for unwinding and getting away from life\'s stresses.', '12.337423518075498', '121.40049221205349'),
(56, 'Abintang', 'Bulalacao', 'Abintang, Nasucob, Bulalacao', 'Destination', 'Bulalacao/abintang.jpg', 'Abintang is a breathtaking view deck from Bulalacao\'s uphill. This area offers a panoramic view of the seascapes of Buyayao, Suguicay, and Semirara Islands in Antiquea.', '12.350837584019414', '121.32870316474367'),
(57, 'Bagong Sikat Falls', 'Bulalacao', 'Bagong Sikat, Bulalacao', 'Destination', 'Bulalacao/bagong sikat falls.jpg', 'Bagong Sikat Falls is a one-story tall waterfall with a deep and wide catch basin. It takes about 45 minutes to an hour to trek through rice fields, forested grounds, and a few streams to reach this magnificent waterfall.', '12.366314137051958', '121.27224964301114'),
(58, 'Balatasan Long Beach', 'Bulalacao', 'Balatasan, Bulalacao', 'Destination', 'Bulalacao/balatasan long beach.jpg', 'Apart from serving as a departure point for trips to Maasin and Tambaron Islands, this long stretch of white sand beach in Brgy. Balatasan has clear waters that are ideal for swimming and other water activities. Balatasan Long Beach is the ideal getaway, with huts and floating cottages available.', '12.312501837720028', '121.37263034885359'),
(59, 'Boulevard', 'Bulalacao', 'Maasin, Bulalacao', 'Destination', 'Bulalacao/boulevard.jpg', '', '12.25563310391686', '121.38590411674063'),
(62, 'Aninuan Falls', 'Puerto Galera', 'Aninuan, Puerto Galera', 'Destination', 'Puerto Galera/aninuan.jpg', 'Aninuan Falls, a 4-meter waterfall in Aninuan, Puerto Galera, is nestled at the foot of Mt. Malasimbo. A 20-30 minute hike will take you to the falls\' cool and refreshing water.', '13.482743487279102', '120.90651983956802'),
(66, 'Aplayang Munti', 'Puerto Galera', 'Dulangan, Puerto Galera', 'Destination', 'Puerto Galera/aplayang munti.jpg', 'Aplayang Munti, also known as Virgin Island\'s Pebble Beach, has a beautiful rock formation and a beautiful view of the sea. Its tranquil setting and calm waters are ideal for relaxing and meditating.', '13.476945191372163', '120.97169835121355'),
(67, 'Haligi Beach', 'Puerto Galera', 'Sto. Nino, Puerto Galera', 'Destination', 'puerto galera/haligi.jpg', 'Haligi Beach is a lovely small beach in a cove. Its most appealing features are its white sand and crystal waters, where one can go swimming or snorkeling.', '13.517915859580498', '120.94287505602497'),
(68, 'Lighthouse Escarceo', 'Puerto Galera', 'Sinandigan, Puerto Galera', 'Destination', 'Puerto Galera/lighthouse.jpg', 'The derelict lighthouse and the remains of the old lighthouse living quarters, built in 1955, are located directly on top of the Puerto Galera dive sites.', '13.521801413746635', '120.99305432165276'),
(70, 'Silad Island', 'Bulalacao', 'Milagrosa, Bulalacao', 'Destination', 'Bulalacao/silad island.jpg', 'The island\'s coral-filled and yellowish sands complement its bone-like shape. The combination of blue and green seawater, as well as the coconut trees dotting the hill in the background, creates a view that is not only visually appealing, but also provides a soothing experience of island life.', '12.250543218214789', '121.25137184915486'),
(71, 'Tambaron Island', 'Bulalacao', 'Tambaron, Maasin Bulalacao', 'Destination', 'Bulalacao/tambaron island.jpg', 'Tambaron is the most developed of Bulalacao\'s islands and islets. Tourists can spend the night in cabanas or fan rooms.', '12.273166392153003', '121.38012889285666'),
(72, 'Target Island', 'Bulalacao', 'Milagrosa, Bulalacao', 'Destination', 'Bulalacao/target island.jpg', 'Target Island, also known as Alibatan Island in Bulalacao, Oriental Mindoro, was used as a bombing practice site during WWII. The 5-hectare island, surrounded by white sand beaches, has a lagoon in the center, which is thought to have formed as a result of the bombings.', '12.215698653396185', '121.28209899671097'),
(73, 'Buktot Beach', 'Mansalay', 'Manaul, Mansalay', 'Destination', 'Mansalay/buktot.jpg', 'Buktot Beach is a natural wonder with powdery white sands and stunning rock formations. It rents out cabanas so that family and friends can enjoy the summer breeze at Mansalay\'s hidden gem.', '12.448727042659604', '121.4203593603086'),
(74, 'Casabangan Beach/ Marine Protected Areas', 'Mansalay', 'Don Pedro, Mansalay', 'Destination', 'Mansalay/casabangan.jpg', 'Casabangan Beach is famous for its crystal clear blue waters and fine white sand. Swimming and snorkeling are the best ways to enjoy this picturesque location.', '12.505163341472436', '121.3207687988504'),
(75, 'La Roza Del Marie Beach Resort', 'Mansalay', 'Brgy. Wasig, Mansalay', 'Destination', 'Mansalay/la roza.jpg', 'This quaint and charming Mansalay destination provides a peaceful haven as you take in the beauty of the panoramic view of where the sky meets the sea.', '12.546094989503839', '121.49456003471704'),
(76, 'Mangyan Burial Cave', 'Mansalay', 'Sitio Palaypay, B. Del Mundo, Mansalay', 'Destination', 'Mansalay/mangyan burial.jpg', 'Mangyan Burial Cave is located on the Palaypay Cove Fish Sanctuary\'s coast. It is here that the ancient Mangyans\' sacred site can be found. Although most of the Mangyans\' remains have been washed away into the adjacent sea, some remain hidden beneath boulders and massive rocks.', '12.532442624818247', '121.46275734274697'),
(77, 'Mangyan Villages', 'Mansalay', 'Panaytayan, Mansalay', 'Destination', 'Mansalay/mangyan villages.jpg', 'Mangyan Village is located in Mansalay\'s Barangay Panaytayan. This Mangyan Settlement is ideal for those interested in learning about the Hanunuo Mangyans\' rich culture and traditions.', '12.551276723787167', '121.34748635423543'),
(78, 'Mansalay Eco Park', 'Mansalay', 'Sitio Barubo, B. Del Mundo, Mansalay', 'Destination', 'Mansalay/mansalay eco park.jpg', 'The Mansalay Eco Park provides a panoramic view of the Mansalay lowlands and the Tablas Strait. During the Lenten season, the eco park is a popular pilgrimage site in the province.', '12.551431463970022', '121.471149509113'),
(79, 'Mt. Abenlay Eco Tour Monkey Trail', 'Mansalay', 'Budburan, Mansalay', 'Destination', 'Mansalay/mt abenlay.jpg', 'Located on the outskirts of Brgy. Budburan, Mansalay, and Mt. Abenlay Eco Tour Monkey Trail provide a scenic landscape where visitors can see monkeys from the viewing deck area in Budburan.', '12.474113489513856', '121.33879861934541'),
(80, 'Palaypay Fish Sanctuary', 'Mansalay', 'Sitio Palaypay, B. Del Mundo, Mansalay', 'Destination', 'Mansalay/palaypay.jpg', 'The Palaypay Fish Sanctuary in Mansalay is a haven of rich marine biodiversity, a refuge for various corals, acquatic rocks, and marine species. The beach area is made even more relaxing by the presence of large aquatic trees and mangroves.', '12.517824057629266', '121.45807384347485'),
(81, 'Sunken Cemetery', 'Mansalay', 'Sitio Alegria, Sta. Brigida, Mansalay', 'Destination', 'Mansalay/sunken cemetery.jpg', 'The Sunken Cemetery is where the remains of ancient Mansalay residents were interred. The sunken cemetery is visible during low tide, and the gravestones can be seen from a distance.', '12.566867528287624', '121.50138522284094'),
(82, 'Avida Dane Farm Resort', 'Roxas', 'San Aquilino, Roxas', 'Destination', 'Roxas/avida.jpg', 'Avida Dane Farm Resort provides a more secluded and private getaway with function halls, a garden with playgrounds, and a swimming pool.', '12.586405856458445', '121.48769617446172'),
(83, 'Greenscape Beach Resort', 'Roxas', 'San Jose, Roxas', 'Destination', 'Roxas/greenscape.jpg', 'This day tour destination allows you to enjoy the sea and their swimming pool at the same time. The most popular activities here are videoke and picnics.', '12.594641833903038', '121.52538163891764'),
(84, 'JC Infinity Beach Resort', 'Roxas', 'San Jose, Roxas', 'Destination', 'Roxas/jc infinity.jpg', 'This is the place to go if you want both saltwater and a swimming pool. Their infinity pool is worth a visit with family and friends.', '12.601116210531364', '121.54143424076551'),
(85, 'San Rafael Cave', 'Roxas', 'San Rafael, Roxas', 'Destination', 'Roxas/san rafael cave.jpg', 'San Rafael Cave is the largest cave in eastern Mindoro and is roughly the size of a cathedral. It is a 7-chamber cave located approximately 8 kilometers south of Roxas town proper and has been declared safe for tourism activity by the Department of Environment and Natural Resources (DENR) (Classification III). The cave is divided into ten chambers, each of which takes about two hours to explore. The first seven chambers are easily accessible, while the eighth requires crawling through a narrow passageway', '12.63941218101686', '121.42876518438264'),
(86, 'Agsalin Fish Sanctuary', 'Gloria', 'Agsalin, Gloria', 'Destination', 'Gloria/agsalin.jpg', 'At the Para el MAR: MPA Awards and Recognitions 2017, Agsalin Fish Sanctuary was named Top Performing MPA in the United States. The sanctuary has 80.13 hectares of coral reef and subtidal sea grass beds where you can try kayaking and snorkeling.', '12.880188720497369', '121.47474618251839'),
(87, 'Bamboo Plantation', 'Gloria', 'Malubay, Gloria', 'Destination', 'Gloria/bamboo plantation.jpg', 'The Municipal Bamboo Plantation is a diverse bamboo plantation that houses various varieties of bamboos used for local livelihood. Relax and enjoy a picnic beneath the cool shade of the bamboos.', '12.942500444027058', '121.40858148922922'),
(88, 'M. Adriatico Pottery', 'Gloria', 'M. Adriatico, Gloria', 'Destination', 'Gloria/adriatico pottery.jpg', 'Visitors can see the art and process of pottery making at Macario Adriatico in Gloria. One of the oldest Filipino decorative arts is made with clay and fire at M. Adriatico Poterry.', '12.921452533891358', '121.32866381516827'),
(89, 'Sta. Theresa Fish Sanctuary', 'Gloria', 'Sta. Theresa, Gloria', 'Destination', 'Gloria/sta theresa.jpg', 'Sta. The Theresa Fish Sanctuary is a 14-hectare marine preserve (MPA). Snorkeling is one of the activities available at the sanctuary, which is home to a wide range of marine flora and fauna.', '12.920030552695216', '121.48171129574645'),
(90, 'Walang Langit Falls', 'Gloria', 'Buong Lupa, Gloria', 'Destination', 'Gloria/walang langit.jpg', 'Walang Langit Falls got its name from the dense canopy of trees that covered the area in the early 1990s. The canopy in the gorge leading to the falls was dense at the time, and the area was so dark that travelers needed flashlights to navigate their way around. Unfortunately, in the late 1990s, the landowners cut down the trees, exposing Walang Langit Falls to sunlight.', '12.975792214038973', '121.4717412255529,'),
(91, 'Casa Del Rio', 'Socorro', 'Fortuna, Socorro', 'Destination', 'Socorro/casa del rio.jpg', 'Casa del Rio is located on the other side of the Fortuna Hanging Bridge and features floating cottages and riverbank huts ideal for recreational activities with friends and family.', '13.029789758573267', '121.32960856775867'),
(92, 'City of Hearts', 'Socorro', 'Fortuna, Socorro', 'Destination', 'Socorro/city of hearts.jpg', 'This secluded resort provides peace and quiet for friends and family. With a variety of pools of varying depths, cottages, a beautiful landscape, and a playground, this location is suitable for everyone.', '13.037689031683922', '121.27129083892348'),
(93, 'Naujan Lake Boardwalk And Bicycle Lane', 'Socorro', 'Batong Dalig, Socorro', 'Destination', 'Socorro/naujan lake boardwalk.jpg', 'This boardwalk and bicycle lane near Naujan Lake in Batong Dalig is ideal for recreational and physical activities such as walking, biking, and jogging. Exercise your body and mind while admiring the stunning view of Naujan Lake.', '13.104643432816356', '121.33084809908044'),
(94, 'SAHSPI (St. Augustine House Of Spirituality)', 'Socorro', 'Subaan, Socorro', 'Destination', 'Socorro/sahspi.jpg', 'This location is ideal for religious activities and retreats because it allows you to reconnect with your spirituality and faith. During the Lenten season, they offer pilgrimage, religious camps, and other faith tourism activities.', '13.077092252260597', '121.36252686951619'),
(95, 'SAKAF (Samahan Para Sa Kabuhayan Ng Fortuna)', 'Socorro', 'Fortuna, Socorro', 'Destination', 'Socorro/sakaf.jpg', 'A community-based sustainable tourism organization manages an ecotourism destination in Fortuna, Soccoro that offers activities such as kayaking, floating cottages, and swimming, among others.', '13.03767857941706', '121.27140885611269'),
(96, 'Bihiya Beach', 'Pola', 'Misong, Pola', 'Destination', 'Pola/bihiya.jpg', 'Beachgoers are awestruck by its gorgeous creamy white sand and pristine waters, which are comparable to other well-known beaches in the country. Its overall laid-back appeal, low-lying coconut trees, and a 200-meter beachfront make you forget your worries and let the stress slip away.', '13.204320554234236', '121.43068887480673'),
(97, 'Bilog Lagoon', 'Pola', 'Bacawan, Pola', 'Destination', 'Pola/bilog lagoon.jpg', 'This mystical body of water in Bacawan, Pola contains crystal clear water into which one can take a refreshingly deep dip.', '13.125432488251542', '121.53318549093777'),
(98, 'Kabilang Ibayo Beach', 'Pola', 'Batuhan, Pola', 'Destination', 'Pola/kabilang ibayo.jpg', 'Kabilang Ibayo Beach is a long stretch of beachfront ideal for walking, jogging, and other physical activities while basking in the sun and sea breeze.', '13.135566869980705', '121.45453894575523'),
(99, 'Lambanog Beach', 'Pola', 'Misong, Pola', 'Destination', 'Pola/lambanog.jpg', 'Lambanog Beach, accessible by boat or banca, is an unspoiled beach destination in Pola. Lambanog Beach is known for its superfine white sand and crystalline waters teeming with corals and marine life.', '13.210156519360673', '121.42884399593623'),
(100, 'Mangrove Eco Park', 'Pola', 'Batuhan, Pola', 'Destination', 'Pola/mangrove eco park.jpg', 'The Mangrove Eco Park in Pola is home to some of Oriental Mindoro\'s oldest and rarest magroves. A boat ride around Batuhan\'s mangrove area makes you appreciate nature even more. The canopy of mangrove tree branches is the most distinguishing feature of the magrove area, and it will undoubtedly take your breath away.', '13.133029702361334', '121.45660724145667'),
(101, 'Pola Heritage Houses', 'Pola', 'Poblacion, Pola', 'Destination', 'Pola/pola heritage.jpg', 'Because of its historical significance, Pola is known as the Oriental Mindoro Heritage Town.', '13.146820299899275', '121.43219443426888'),
(102, 'Tagumpay Beach', 'Pola', 'Tagumpay, Pola', 'Destination', 'Pola/tagumpay beach.jpg', 'Approximately 9 kilometers away from Pola Town proper is Tagumpay Beach, one of the most frequented beaches in Pola with its fine white sand, relaxing ocean breeze and refreshing blue waters.', '13.208874016666508', '121.41742802821612'),
(103, 'Talon Falls / Calima Falls', 'Pola', 'Calima, Pola', 'Destination', 'Pola/talon falls.jpg', 'Calima Falls, also known as Talon Falls by locals, is about a 40-minute hike away. The only way to get to the falls is to walk through the rocky gorge. The cascades of the falls are refreshing and will undoubtedly energize your body and mind.', '121.41742802821612', '121.48556368209533'),
(104, 'Tungtong Point', 'Pola', 'Bayanan, Pola', 'Destination', 'Pola/tungtong.jpg', 'Tungtong Point, a protruding rock, is said to resemble a giant octopus head. Above the rock formation is the St. John the Baptist Prayer Park, where you can relax and meditate while overlooking Pola Bay.', '13.164452012723839', '121.4286795239267'),
(105, 'Blanco Beach Resort', 'Pinamalayan', 'Marfrancisco, Pinamalayan', 'Destination', 'Pinamalayan/balnco beach.jpg', 'Blanco Beach Resort offers cabins and cottages for rent. This destination is ideal for family gatherings or outings with friends because it allows you to enjoy the sun, sea, and sand at their best.', '13.064730712646025', '121.51607495340245'),
(106, 'Cawa-Cawa Falls', 'Pinamalayan', 'Buli, Pinamalayan', 'Destination', 'Pinamalayan/cawa cawa.jpg', 'The name of this waterfall in Pinamalayan comes from its cauldron shape. The falls are only a short walk away. Interestingly, there are many myths and folktales surrounding Cawa-cawa Falls that are as entertaining as the swimming activities themselves.', '13.096451235384492', '121.49876653976827'),
(107, 'Del Bae Beach Resort', 'Pinamalayan', 'Guinhawa, Pinamalayan', 'Destination', 'Pinamalayan/del bae.jpg', 'Del Bae Beach Resort is ideal for picnics, gatherings of family and friends, or just a fun weekend getaway, with cottages available for day tours.', '13.063871614074632', '121.51670996860466'),
(108, 'El Dionisio Paraiso White Beach Resort', 'Pinamalayan', 'Brgy. Banilad, Pinamalayan', 'Destination', 'Pinamalayan/el dionisio.jpg', '', '13.081800469238903', '121.54657789108883'),
(109, 'Pili-Banilad-Ranzo Biking Trail', 'Pinamalayan', 'Pili, Banilad and Ranzo, Pinamalayan', 'Destination', 'Pinamalayan/pili banilad.jpg', 'This coastal road in Pinamalayan will give you readtrip vibes, with a portion of it comparable to Patapat Viaduct in Pagudpud. The sea breeze will energize you as you travel along the road facing the beach while biking.', '13.102709237272164', '121.54559874800259'),
(110, 'Pinamalayan Municipal Park', 'Pinamalayan', 'Zone 3, Pinamalayan', 'Destination', 'Pinamalayan/park.jpg', 'The town\'s activities and events are held in the Pinamalayan Municipal Park, which is located in front of the Municipal Hall. There are several playgrounds and monuments within the park that commemorate significant events in Pinamalayan\'s history.', '13.036097423974812', '121.48544039216188'),
(111, 'Pinamalayan Rainbow Junction/Marfranisco Triangle', 'Pinamalayan', 'Marfrancisco, Pinamalayan', 'Destination', 'Pinamalayan/rainbow.jpg', 'The Pinamalayan Rainbow Junction is a vibrant landmark located along the Strong Republic Nautical Highway that displays the town\'s emblem, the rainbow, as a testament to its vibrant culture and history.', '13.034659417419256', '121.4828336427515'),
(112, 'Pinamalayan Welcome Arch', 'Pinamalayan', 'Sto. Nino, Pinamalayan', 'Destination', 'Pinamalayan/welcome arch.jpg', 'You will be greeted by this colorful and artistic arch which welcomes you when you enter the Municipality of Pinamalayan.', '13.065524812726578', '121.45572698985042'),
(113, 'Ranzo Fish Sanctuary', 'Pinamalayan', 'Ranzo, Pinamalayan', 'Destination', 'Pinamalayan/ranzo.jpg', 'This location in Brgy. Ranzo, Pinamalayan is a rich marine sanctuary. With such clear water and a calm sea, you can try activities such as kayaking, snorkeling, and even diving.', '13.113906308629295', '121.55198354655103'),
(114, 'Ranzo Light House', 'Pinamalayan', 'Ranzo, Pinamalayan', 'Destination', 'Pinamalayan/ranzo light house.jpg', 'After a 20-minute hike, you\'ll arrive at Ranzo Lighthouse, which provides a panoramic view of the Ranzo Fish Sanctuary and beyond.', '13.117092108626045', '121.55266285078486'),
(115, 'Wawa Mangrove Forest And Kayaking Site', 'Pinamalayan', 'Wawa, Pinamalayan', 'Destination', 'Pinamalayan/wawa mangrove.jpg', 'Explore and paddle through the mangrove forest at this kayaking adventure site to appreciate nature\'s beauty.', '13.038914136511593', '121.48162404590963'),
(116, 'Bato Creek Kayaking & White Water Rafting', 'Victoria', 'Villa Cerveza, Victoria', 'Destination', 'Victoria/bato creek.jpg', 'Enjoy the relaxing summer atmosphere and cool waters of the Bato Creek River in Villa Cerveza, Victoria. It is an ideal summer destination for thrilling water activities such as kayaking and whitewater rafting while enjoying the peaceful scenery of lush trees along the river.', '13.100792533944295', '121.17603671193655'),
(117, 'Equias Integrated Farm', 'Victoria', 'Victoria', 'Destination', 'Victoria/equias.jpg', 'Equias Integrated Farm, an accredited Learning Site for Agriculture, is a must-see farm tourism site in Victoria because it provides farm activities for both educational and recreational purposes.', '13.153093001351506', '121.28904819856676'),
(118, 'Kuatro Maria\'s Agroecology Farm', 'Victoria', 'San Narciso, Victoria', 'Destination', 'Victoria/kuarto marias.jpg', 'Kuatro Maria\'s Agroecology Farm is a well-known farm tourism destination that can be visited for both recreational and educational purposes.', '13.193019612790279', '121.31160649800569'),
(119, 'Mabalbay Falls', 'Victoria', 'Villa Cerveza, Victoria', 'Destination', 'Victoria/mabalbay.jpg', 'Mabalbay Falls, a hidden gem in Villa Cerveza Vicotria, is about 40 minutes of trekking and stream crossing away. This destination is ideal for those who enjoy adventure, as getting to the waterfalls requires some skill.', '13.122058515972487', '121.19979453892454'),
(120, 'VCDC Farm', 'Victoria', 'Brgy. Malamig, Leido, Victoria', 'Destination', 'Victoria/vcdc farm.jpg', 'VCDC Farm, located in Victoria, is a Farm Tourism Site as well as an ATI Learning Site for Agriculture. This farm and educational facility is well-known for its all-natural products, which include Ginger Brew, Turmeric Brew, Ginger Turmeric Brew, Ginger Turmeric Candy, and Calamansi Concentrate.', '13.178115914321964', '121.27692833042346'),
(121, 'Victoria Nature Park', 'Victoria', 'Bambanin, Victoria', 'Destination', 'Victoria/victoria nature park.jpg', 'Victoria Nature Park is the province\'s first Integrated Permaculture Farm, with a relaxing setting overlooking Naujan Lake. 17 hectares of land are dedicated to the production of high-quality agricultural products as well as farm tours, visits, and educational demonstrations.', '13.159069771784536', '121.25329204911571'),
(122, '333 Steps', 'Naujan', 'Melgar A, Naujan', 'Destination', 'Naujan/333.jpg', 'It takes 333 steps to get to the top, where there is an altar where tourists can cast their wishes. Each step becomes more difficult, but the view at the top is breathtaking, with a panoramic view of Naujan and the sea.', '13.264475934711994', '121.34869187404206'),
(123, 'Arangin Falls', 'Naujan', 'Arangin, Naujan', 'Destination', 'Naujan/arangin.jpg', 'Arangin Falls is a one-of-a-kind waterfall with many levels that cascade down the side of a mountain. The waterfall cascades into a small basin, which is used for picnics.', '13.224193949318177', '121.11741973258721'),
(124, 'Buloc-Buloc Cove', 'Naujan', 'Montemayor, Naujan', 'Destination', 'Naujan/buloc buloc.jpg', 'Buloc-buloc Cove is a 72-hectare Marine Protected Area (MPA) known as BuCoMaPA. Aside from the cove itself, a boat can take you to and into a charming and mystical cave.', '13.23660485071245', '121.40357840706096'),
(125, 'Dao Water Lily Mini Park', 'Naujan', 'Dao, Naujan', 'Destination', 'Naujan/dao water.jpg', 'At Dao Waterlily Mini Park in Naujan, you\'ll find ultimate bliss aboard a floating cottage. Their inventive handicrafts and souvenirs made of dried waterlilies are also on display in the park.', '13.248641743043818', '121.31639489558691'),
(126, 'Karacha Falls', 'Naujan', 'Malvar, Naujan', 'Destination', 'Naujan/karacha.jpg', 'You\'ll follow off-the-beaten-path paths and off-road tracks to Karacha Falls in Malvar. When you arrive at your destination, you can already see the manifestation of nature. A swimmable stream with cottages and huts is located below. The majestic, towering waterfalls with cool cascades are further up, across the rocky path.', '13.188720505745213', '121.15051663716216'),
(128, 'Naujan Lake', 'Naujan', 'Bayani, Naujan', 'Destination', 'Naujan/naujan lake.jpg', 'The Ramsar Convention has designated Naujan Lake as a \"wetland of international importance,\" making it the fifth largest lake in the Philippines and the largest freshwater lake in Oriental Mindoro. The municipalities of Naujan, Victoria, Socorro, and Pola surround it. The lake is home to a diverse range of local and migratory fish and water birds.', '13.241203800155475', '121.34085083145541'),
(129, 'Naujan Town Plaza', 'Naujan', 'Poblacion, Naujan', 'Destination', 'Naujan/palza.jpg', 'Liwasang Bonifacio is the town plaza in front of Naujan Municipal Hall, where the town\'s activities and events are held.', '13.330801328933381', '121.30025235900705'),
(130, 'Paitan River', 'Naujan', 'Paitan, Naujan', 'Destination', 'Naujan/paitan river.jpg', 'Paitan River is a wide and deep river with minor rapids near a Mangyan Village in Naujan. It used to be a hydroelectric power plant and faces Mt. Halcon.', '13.186677814551361', '121.07650509452601'),
(131, 'Pungao Hot Spring / Montelago Hot Spring', 'Naujan', 'Montelago, Naujan', 'Destination', 'Naujan/pungao hot spring.jpg', 'Brgy. Pungao Hot Spring For a long time, Montelago has been healing the locals. The volcanic hot spring is located about 800 meters from the two islets in Naujan Lake. Pungao Hot Spring is located at the foot of hills covered in igneous rock formations. Swimming and therapeutic bathing, island hopping, and bird watching are all popular activities at the attraction site. Furthermore, migratory birds can be seen from February to March.', '13.222644500810345', '121.37563895140353'),
(132, 'Simbahang Bato', 'Naujan', 'Bancuro, Naujan', 'Destination', 'Naujan/simbahang bato.jpg', 'The Bancuro Church Ruins in Naujan, also known as the Simbahang Bato, were constructed around 1680 by Augustinian missionaries eager to bring Christianity to the first settlers. Made of adobe and corals, it served as a house of prayer for devotees as well as a fortress against Moro raids. It was looted and burned on September 11, 1824, during the massive Moro raid \"Asultos de Moro.\" During WWII, the ruins of the original structure served as a refuge for the townspeople from Japanese soldiers. After centuries of decay, the locals resurrected it by constructing a \"church within a church.\" The Simbahang Bato reflects Naujeos\' fervent devotion as well as Naujan\'s timeless history.', '13.28152850512451', '121.32189002740324'),
(133, 'Turtle Island', 'Naujan', 'Herrera, Naujan', 'Destination', 'Naujan/turtle island.jpg', 'This destination in Naujan can be reached by boat and is named after the island\'s distinctive turtle shape. Turtle Island is surrounded by white sand and clear blue water, making it the ideal island getaway.', '13.215584470196294', '121.39243255027779'),
(134, 'Long Beach', 'Puerto Galera', 'San Antonio, Puerto Galera', 'Destination', 'Puerto Galera/long beach.jpg', 'Long Beach in San Antonio, with a magnificent panoramic view of the sea, is ideal for those looking for a more secluded beach destination. This unspoiled beach with a long stretch of creamy white sand and clear waters offers solitude and an escape from Puerto Galera\'s busy shores.', '13.527611915215338', '120.94866330999989'),
(135, 'Muelle Cultural Heritage Park', 'Puerto Galera', 'Poblacion, Puerto Galera', 'Destination', 'Puerto Galera/melle cultural.jpg', 'The Muelle Bay in Puerto Galera has been named one of the world\'s most beautiful bays by the Paris-based Les Plus Belles Baies Du Monde (The World\'s Most Beautiful Bays) Club. Puerto Galera, also known as the Heart of Asia, is a popular vacation destination due to its beautiful beaches and proximity to Manila. With its breathtaking views and amazing boardwalk, the pier area, which has been refurbished to become the Puerto Galera Muelle Bay Cultural Heritage Park, has beautiful scenery, landscape, and attractions.', '13.502802636057806', '120.95377962792261'),
(136, 'Puerto Galera Windmill Farm', 'Puerto Galera', 'Baclayan, Puerto Galera', 'Destination', 'Puerto Galera/windmill.jpg', 'The Puerto Galera Windmill Farm area offers a mejestic and almost surreal view of the entire town of Puerto Galera and the adjacent turquoise sea in the Verde Island Passage, with its wind turbines placed atop the mountains in Baclayan at nearly 1,000 meters above sea level.', '13.468046831231577', '120.92745932422616'),
(137, 'Puerto Mangrove Conservation And Eco Tourism Area', 'Puerto Galera', 'Sigayan Tabinay, Puerto Galera', 'Destination', 'Puerto Galera/puerto mangrove.jpg', 'The mangrove reserve is reached via a long stretch of well-kept wooden boardwalk where one can exercise both the body and the mind. The Puerto Galera Mangrove Conservation and Ecotourism Area is a must-see if you want to spend your vacation in a quiet and peaceful setting where you can rest and enjoy nature\'s beauty.', '13.478798690388713', '120.96862472478364'),
(138, 'Talipanan Falls', 'Puerto Galera', 'Aninuan, Puerto Galera', 'Destination', 'Puerto Galera/talipanan.jpg', 'The track to Talipanan Falls winds for about 30 minutes uphill and through the forests and a number of streams from Iraya Mangyan Village to a two-tiered swimmable falls with a shallow basin.', '13.494627843209434', '120.88890506470759'),
(139, 'Talipanan Mangyan Village', 'Puerto Galera', 'Aninuan, Puerto Galera', 'Destination', 'Puerto Galera/talipanan mangyan.jpg', 'The Iraya Mangyan village in Talipanan, Puerto Galera, is where you can see the locals\' ingenuity and immerse yourself in their culture. A variety of handicrafts and hand-made products, such as baskets, bags, and household items made of nito, rattan, and other natural materials, are on display.', '13.494344939763023', '120.88933824513576'),
(140, 'Tamaraw Falls', 'Puerto Galera', 'Villaflor, Puerto Galera', 'Destination', 'Puerto Galera/tamaraw falls.jpg', 'This beautiful waterfall is one of the easiest to reach in Oriental Mindoro. Brgy. is located along the highway. Villaflor is a popular stopover for visitors heading to other tourist attractions in Puerto Galera.', '13.45044999291879', '120.99148683402352'),
(141, 'Tukuran Falls, Puerto Galera, Oriental Mindoro', 'Puerto Galera', 'Villaflor, Puerto Galera', 'Destination', 'Puerto Galera/tukuran falls.jpg', 'Tukuran Falls, accessible via a carabao-drawn cart ride, provides a refreshing hidden getaway. Wading in the lagoon below or the cool cascades of the falls above the rock formation are options for visitors.', '13.433836360967264', '120.97472473587139'),
(142, 'Under water Cave', 'Puerto Galera', 'San Antonio, Puerto Galera', 'Destination', 'Puerto Galera/under water cave.jpg', 'The Underwater Cave in San Antonio is a popular stop on the island hopping tour in Puerto Galera. Its entrance is in a cove where the cave is partially submerged in ocean water. The water is waist-deep and shielded from the ocean waves, making it ideal for swimming and wading.', '13.516791518827901', '120.95927773217632'),
(143, 'White Beach, Puerto Galera, Oriental Mindoro', 'Puerto Galera', 'San Isidro (White Beach), Puerto Galera', 'Destination', 'Puerto Galera/white beach.jpg', 'This most frequented and most famous beach in Oriental Mindoro is located in Brgy. San Isidro, Puerto Galera. It has fine white sand and clear blue water with a variety of water activities to try.', '13.505113375072547', '120.90127131382233'),
