(154, 'By The Sea Hotel And Coffee Shop Inc.', 'Bulalacao', 'Kabangkalan, Poblacion, Bulalacao', 'Hotel', 'Bulalacao/by the sea.jpg', '', '12.31354000369003', '121.33756356972391'),
